    if (!address) return 'N/A';
    const clean = address.trim();
    if (clean.length <= 40) return clean;
    const mid = Math.floor(clean.length / 2);
    const breakIndex = clean.lastIndexOf(' ', mid);
    if (breakIndex === -1) return clean;

    const part1 = clean.slice(0, breakIndex);
    const part2 = clean.slice(breakIndex + 1);
    return (
      <>
        {part1}
        <br />
        {part2}
      </>
    );
